import React, { useState, useEffect } from 'react';
import { BarChart, Bar, PieChart, Pie, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { Brain, TrendingUp, Users, AlertCircle, MessageSquare, Download, Sparkles, Send } from 'lucide-react';
import pako from 'https://cdn.skypack.dev/pako@2.1.0';

const EMBEDDED_DATA = ``;

const SurveyAnalyticsDashboard = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [surveyData, setSurveyData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [aiInsights, setAiInsights] = useState('');
  const [selectedAnalysis, setSelectedAnalysis] = useState(null);
  const [customPrompt, setCustomPrompt] = useState('');
  const [apiKey, setApiKey] = useState('');
  const [showApiKeyInput, setShowApiKeyInput] = useState(false);
  const [error, setError] = useState(null);

  const COLORS = ['#EC4899', '#10B981', '#3B82F6', '#F59E0B', '#8B5CF6', '#EF4444', '#14B8A6', '#F97316'];

  useEffect(() => {
    loadSurveyData();
    const savedKey = localStorage.getItem('groq_api_key');
    if (savedKey) setApiKey(savedKey);
  }, []);

  const saveApiKey = () => {
    localStorage.setItem('groq_api_key', apiKey);
    setShowApiKeyInput(false);
    alert('Groq API key saved! ');
  };

  const loadSurveyData = async () => {
    setLoading(true);
    setError(null);
    
    try {
      console.log(' Decompressing embedded survey data...');
      
      // Decode base64
      const binaryString = atob(EMBEDDED_DATA);
      const bytes = new Uint8Array(binaryString.length);
      for (let i = 0; i < binaryString.length; i++) {
        bytes[i] = binaryString.charCodeAt(i);
      }
      
      // Decompress
      const decompressed = pako.ungzip(bytes, { to: 'string' });
      const rows = JSON.parse(decompressed);
      
      console.log(` Loaded ${rows.length} survey responses`);
      
      // Map data to dashboard format
      const mappedData = mapExcelToDashboard(rows);
      setSurveyData(mappedData);
      
    } catch (err) {
      console.error(' Error loading survey data:', err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const mapExcelToDashboard = (rows) => {
    console.log('  Mapping data for dashboard...');
    
    // University distribution
    const uniCounts = {};
    rows.forEach(r => {
      const uni = r['which_higher_education_institution_do_you_or_did_you_study_at?'];
      if (uni?.toString().trim()) uniCounts[uni] = (uniCounts[uni] || 0) + 1;
    });
    const allUniversities = Object.entries(uniCounts)
      .sort((a, b) => b[1] - a[1])
      .map(([name, count]) => ({ name, count }));
    
    const topUniversities = allUniversities.slice(0, 5);
    const othersCount = allUniversities.slice(5).reduce((sum, u) => sum + u.count, 0);
    if (othersCount > 0) topUniversities.push({ name: 'Others', count: othersCount });

    // Year of study
    const yearCounts = {};
    rows.forEach(r => {
      const year = r['what_is_your_current_year_of_study_as_of_2025?'];
      if (year?.toString().trim()) yearCounts[year] = (yearCounts[year] || 0) + 1;
    });
    const yearOfStudy = Object.entries(yearCounts)
      .map(([year, count]) => ({ year, count }))
      .sort((a, b) => b.count - a.count);

    // Majors
    const majorCounts = {};
    rows.forEach(r => {
      const major = r['which_of_the_following_best_describes_the_main_subject_that_you_are_studying?'];
      if (major?.toString().trim()) majorCounts[major] = (majorCounts[major] || 0) + 1;
    });
    const allMajors = Object.entries(majorCounts)
      .map(([major, count]) => ({ major, count }))
      .sort((a, b) => b.count - a.count);

    // Gender
    const genderCounts = {};
    rows.forEach(r => {
      const gender = r['what_is_your_gender?'];
      if (gender?.toString().trim()) genderCounts[gender] = (genderCounts[gender] || 0) + 1;
    });
    const gender = Object.entries(genderCounts).map(([gender, count]) => ({ gender, count }));

    // Interests
    const interestMapping = {
      'types_of_roles_available:what_do_you_wish_to_learn_more_about_regarding_the_organisation_as_an_employer?_(pick_3)': 'Types of Roles',
      'career_progression_and_development:what_do_you_wish_to_learn_more_about_regarding_the_organisation_as_an_employer?_(pick_3)': 'Career Progression',
      'compensation_and_benefits:what_do_you_wish_to_learn_more_about_regarding_the_organisation_as_an_employer?_(pick_3)': 'Compensation & Benefits',
      'work-life_balance_and_culture:what_do_you_wish_to_learn_more_about_regarding_the_organisation_as_an_employer?_(pick_3)': 'Work-Life Balance',
      'application_and_interview_process:what_do_you_wish_to_learn_more_about_regarding_the_organisation_as_an_employer?_(pick_3)': 'Application Process'
    };
    
    const interests = Object.entries(interestMapping).map(([col, label]) => {
      const selected = rows.filter(r => r[col]?.toString().trim()).length;
      return { topic: label, selected, percent: (selected / rows.length) * 100 };
    });

    // Motivations
    const motivationCounts = {};
    rows.forEach(r => {
      const motivation = r['which_of_these_factors_would_most_motivate_you_to_apply_for_a_position_at_the_organisation?'];
      if (motivation?.toString().trim()) motivationCounts[motivation] = (motivationCounts[motivation] || 0) + 1;
    });
    const allMotivations = Object.entries(motivationCounts)
      .map(([factor, count]) => ({ factor, count }))
      .sort((a, b) => b.count - a.count);

    // Attractiveness ratings
    const ratingCol = 'on_a_scale_from_1_to_10_(1__low,_10__high),_how_would_you_rate_the_attractiveness_of_the_organisation_as_an_employer?';
    const ratingCounts = {};
    let totalRating = 0, ratingCount = 0;
    
    rows.forEach(r => {
      const rating = r[ratingCol];
      if (rating && !isNaN(rating)) {
        const num = Number(rating);
        ratingCounts[num] = (ratingCounts[num] || 0) + 1;
        totalRating += num;
        ratingCount++;
      }
    });
    
    const attractivenessRatings = Object.entries(ratingCounts)
      .map(([score, count]) => ({ score: Number(score), count }))
      .sort((a, b) => a.score - b.score);

    // Completion metrics
    const completedCount = rows.filter(r => r['status'] === 'Complete').length;
    const completionRate = (completedCount / rows.length) * 100;
    const avgTime = rows.reduce((sum, r) => {
      const time = r['time_taken_seconds'];
      return sum + (time && !isNaN(time) ? Number(time) : 0);
    }, 0) / rows.length;

    // Time buckets
    const timeBuckets = [
      { timeRange: '<1min', min: 0, max: 60, completed: 0, incomplete: 0 },
      { timeRange: '1-2min', min: 60, max: 120, completed: 0, incomplete: 0 },
      { timeRange: '2-5min', min: 120, max: 300, completed: 0, incomplete: 0 },
      { timeRange: '>5min', min: 300, max: Infinity, completed: 0, incomplete: 0 }
    ];
    
    rows.forEach(r => {
      const time = r['time_taken_seconds'];
      const isCompleted = r['status'] === 'Complete';
      if (time && !isNaN(time)) {
        const bucket = timeBuckets.find(b => Number(time) >= b.min && Number(time) < b.max);
        if (bucket) {
          if (isCompleted) bucket.completed++;
          else bucket.incomplete++;
        }
      }
    });

    // Drop-off analysis
    const keyColumns = [
      { col: 'which_higher_education_institution_do_you_or_did_you_study_at?', name: 'University' },
      { col: 'what_is_your_gender?', name: 'Gender' },
      { col: 'which_of_these_statements_best_describes_your_current_perception_of_the_organisation_as_an_employer?', name: 'Employer Perception' },
      { col: ratingCol, name: 'Attractiveness Rating' },
      { col: 'which_of_these_factors_would_most_motivate_you_to_apply_for_a_position_at_the_organisation?', name: 'Motivation Factors' }
    ];
    
    const dropOffPoints = keyColumns
      .map(({ col, name }) => {
        const missing = rows.filter(r => !r[col]?.toString().trim()).length;
        return { question: name, dropRate: parseFloat(((missing / rows.length) * 100).toFixed(1)) };
      })
      .filter(d => d.dropRate > 0);

    console.log(' Data mapping complete');
    
    return {
      totalResponses: rows.length,
      completionRate: parseFloat(completionRate.toFixed(1)),
      avgTimeSeconds: Math.round(avgTime),
      demographics: { 
        universities: allUniversities,
        universitiesForPie: topUniversities,
        yearOfStudy, 
        majors: allMajors,
        majorsTop: allMajors.slice(0, 8),
        gender 
      },
      attractiveness: { 
        ratings: attractivenessRatings, 
        avgRating: ratingCount > 0 ? parseFloat((totalRating / ratingCount).toFixed(2)) : 0 
      },
      interests: { topics: interests.sort((a, b) => b.selected - a.selected) },
      motivations: allMotivations,
      motivationsTop: allMotivations.slice(0, 8),
      completionPatterns: { byTime: timeBuckets, dropOffPoints }
    };
  };

const analyzeWithAI = async (analysisType, userPrompt = null) => {
  if (!apiKey) {
    alert('Please add your Groq API key first!');
    setShowApiKeyInput(true);
    return;
  }

  setLoading(true);
  setSelectedAnalysis(analysisType);
  setAiInsights('Analyzing...');

  try {
    const prompt = userPrompt || `Analyze this survey: ${surveyData.totalResponses} responses, ${surveyData.completionRate}% completion, ${surveyData.attractiveness.avgRating}/10 rating. Top interest: ${surveyData.interests.topics[0].topic}. Give 3 key insights.`;

    const response = await fetch('https://api.groq.com/openai/v1/chat/completions', {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${apiKey}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        model: 'llama-3.1-8b-instant',
        messages: [{ role: 'user', content: prompt }],
        max_tokens: 500,
        temperature: 0.7
      })
    });

    const data = await response.json();
    console.log('Response:', data);
    
    if (data.choices?.[0]?.message?.content) {
      setAiInsights(data.choices[0].message.content);
    } else if (data.error) {
      setAiInsights('Error: ' + data.error.message);
    } else {
      setAiInsights('Error: ' + JSON.stringify(data));
    }

  } catch (err) {
    console.error(err);
    setAiInsights(`Error: ${err.message}`);
  } finally {
    setLoading(false);
  }
};


  const handleCustomPrompt = () => {
    if (!customPrompt.trim()) {
      alert('Please enter a question');
      return;
    }
    analyzeWithAI('custom', customPrompt);
  };

  const exportReport = () => {
    if (!surveyData) return;
    
    const content = `SURVEY ANALYTICS REPORT
Generated: ${new Date().toLocaleDateString()}

KEY METRICS
Total: ${surveyData.totalResponses} | Completion: ${surveyData.completionRate}% | Avg Time: ${surveyData.avgTimeSeconds}s | Avg Rating: ${surveyData.attractiveness.avgRating}/10

TOP INTERESTS
${surveyData.interests.topics.map(t => `${t.topic}: ${t.selected} (${t.percent.toFixed(1)}%)`).join('\n')}

TOP MOTIVATIONS
${surveyData.motivations.slice(0, 10).map((m, i) => `${i+1}. ${m.factor}: ${m.count}`).join('\n')}

ALL UNIVERSITIES
${surveyData.demographics.universities.map((u, i) => `${i+1}. ${u.name}: ${u.count}`).join('\n')}

DROP-OFF POINTS
${surveyData.completionPatterns.dropOffPoints.map(d => `${d.question}: ${d.dropRate}%`).join('\n')}`;

    const blob = new Blob([content], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `survey-report-${new Date().toISOString().split('T')[0]}.txt`;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  const renderCustomLabel = ({ cx, cy, midAngle, outerRadius, name }) => {
    const RADIAN = Math.PI / 180;
    const radius = outerRadius + 40;
    const x = cx + radius * Math.cos(-midAngle * RADIAN);
    const y = cy + radius * Math.sin(-midAngle * RADIAN);
    return (
      <text 
        x={x} 
        y={y} 
        fill="#374151" 
        textAnchor={x > cx ? 'start' : 'end'} 
        dominantBaseline="central" 
        style={{ fontSize: '12px', fontWeight: '500' }}
      >
        {name.length > 15 ? name.slice(0, 15) + '...' : name}
      </text>
    );
  };

  // Loading state
  if (loading && !surveyData) {
    return (
      <div className="flex items-center justify-center h-screen bg-gradient-to-br from-blue-50 to-indigo-100">
        <div className="text-center">
          <div className="animate-spin rounded-full h-16 w-16 border-b-4 border-blue-600 mx-auto mb-4"></div>
          <p className="text-gray-600 text-lg font-semibold">Loading survey data...</p>
          <p className="text-gray-500 text-sm mt-2">Decompressing 1,976 responses...</p>
          {error && (
            <div className="mt-4 p-4 bg-red-50 border border-red-200 rounded-lg max-w-md mx-auto">
              <p className="text-red-700 text-sm">{error}</p>
              <button
                onClick={loadSurveyData}
                className="mt-2 px-4 py-2 bg-red-600 text-white rounded hover:bg-red-700"
              >
                Retry
              </button>
            </div>
          )}
        </div>
      </div>
    );
  }

  // Error state
  if (error && !surveyData) {
    return (
      <div className="flex items-center justify-center h-screen bg-gradient-to-br from-red-50 to-orange-100">
        <div className="text-center max-w-md">
          <AlertCircle className="w-16 h-16 text-red-600 mx-auto mb-4" />
          <h2 className="text-2xl font-bold text-gray-900 mb-2">Failed to Load Data</h2>
          <p className="text-gray-600 mb-4">{error}</p>
          <button
            onClick={loadSurveyData}
            className="px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700"
          >
            Try Again
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-50 to-blue-50">
      {/* Header */}
      <div className="bg-white shadow-sm border-b border-gray-200">
        <div className="max-w-7xl mx-auto px-6 py-6">
          <div className="flex items-center justify-between flex-wrap gap-4">
            <div>
              <h1 className="text-3xl font-bold text-gray-900 flex items-center gap-3">
                <Brain className="w-8 h-8 text-blue-600" />
                Survey Analytics Intelligence
              </h1>
              <p className="text-gray-600 mt-1">AI-powered insights  NUS Datathon "TEAM NAME"  Data embedded</p>
            </div>
            <div className="flex items-center gap-4">
              <button
                onClick={() => setShowApiKeyInput(!showApiKeyInput)}
                className={`px-4 py-2 text-sm font-medium rounded-lg transition-colors ${
                  apiKey 
                    ? 'bg-green-100 text-green-700 border border-green-300'
                    : 'bg-yellow-100 text-yellow-700 border border-yellow-300'
                }`}
              >
                {apiKey ? ' API Key Set' : ' Add FREE API Key'}
              </button>
              <div className="text-right">
                <div className="text-sm text-gray-500">Total Responses</div>
                <div className="text-3xl font-bold text-blue-600">{surveyData.totalResponses}</div>
              </div>
            </div>
          </div>
          
          {showApiKeyInput && (
            <div className="mt-4 p-4 bg-green-50 border border-green-200 rounded-lg">
              <h3 className="font-semibold text-gray-900 mb-2"> Groq API Key Setup</h3>
              <p className="text-sm text-gray-600 mb-3">
                1. Go to <a href="https://console.groq.com/keys" target="_blank" rel="noopener noreferrer" className="text-blue-600 underline font-semibold">console.groq.com/keys</a><br/>
                2. Sign up with Google (30 seconds)<br/>
                3. Click "Create API Key"<br/>
                4. Copy and paste below!
              </p>
              <div className="flex gap-2">
                <input
                  type="password"
                  value={apiKey}
                  onChange={(e) => setApiKey(e.target.value)}
                  placeholder="gsk_..."
                  className="flex-1 px-3 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
                />
                <button
                  onClick={saveApiKey}
                  className="px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors"
                >
                  Save
                </button>
              </div>
            </div>
          )}
        </div>
      </div>

      {/* Tabs */}
      <div className="bg-white border-b border-gray-200 sticky top-0 z-10 shadow-sm">
        <div className="max-w-7xl mx-auto px-6">
          <div className="flex gap-1 overflow-x-auto">
            {[
              { id: 'overview', label: 'Overview', icon: TrendingUp },
              { id: 'demographics', label: 'Demographics', icon: Users },
              { id: 'insights', label: 'AI Insights', icon: Sparkles },
              { id: 'completion', label: 'Completion', icon: AlertCircle }
            ].map(tab => {
              const Icon = tab.icon;
              return (
                <button
                  key={tab.id}
                  onClick={() => setActiveTab(tab.id)}
                  className={`px-6 py-4 font-medium text-sm flex items-center gap-2 border-b-2 transition-colors whitespace-nowrap ${
                    activeTab === tab.id 
                      ? 'border-blue-600 text-blue-600 bg-blue-50' 
                      : 'border-transparent text-gray-600 hover:text-gray-900 hover:bg-gray-50'
                  }`}
                >
                  <Icon className="w-4 h-4" />
                  {tab.label}
                </button>
              );
            })}
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="max-w-7xl mx-auto px-6 py-8">
        {activeTab === 'overview' && (
          <div className="space-y-6">
            {/* Key Metrics */}
            <div className="grid grid-cols-1 md:grid-cols-4 gap-6">
              <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
                <p className="text-sm text-gray-500 mb-1">Completion Rate</p>
                <p className="text-3xl font-bold text-green-600">{surveyData.completionRate}%</p>
              </div>
              <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
                <p className="text-sm text-gray-500 mb-1">Avg Time</p>
                <p className="text-3xl font-bold text-blue-600">{surveyData.avgTimeSeconds}s</p>
              </div>
              <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
                <p className="text-sm text-gray-500 mb-1">Avg Rating</p>
                <p className="text-3xl font-bold text-purple-600">{surveyData.attractiveness.avgRating}/10</p>
              </div>
              <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
                <p className="text-sm text-gray-500 mb-1">Universities</p>
                <p className="text-3xl font-bold text-orange-600">{surveyData.demographics.universities.length}</p>
              </div>
            </div>

            {/* Charts */}
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">Student Interests</h3>
                <ResponsiveContainer width="100%" height={300}>
                  <BarChart data={surveyData.interests.topics}>
                    <CartesianGrid strokeDasharray="3 3" stroke="#f0f0f0" />
                    <XAxis 
                      dataKey="topic" 
                      angle={-45} 
                      textAnchor="end" 
                      height={120} 
                      style={{ fontSize: '11px' }} 
                    />
                    <YAxis />
                    <Tooltip />
                    <Bar dataKey="selected" fill="#3B82F6" radius={[8, 8, 0, 0]} />
                  </BarChart>
                </ResponsiveContainer>
              </div>

              <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">University Distribution</h3>
                <ResponsiveContainer width="100%" height={380}>
                  <PieChart>
                    <Pie
                      data={surveyData.demographics.universitiesForPie}
                      cx="50%"
                      cy="45%"
                      labelLine={{ stroke: '#9CA3AF', strokeWidth: 1 }}
                      label={renderCustomLabel}
                      outerRadius={80}
                      dataKey="count"
                    >
                      {surveyData.demographics.universitiesForPie.map((entry, index) => (
                        <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                      ))}
                    </Pie>
                    <Tooltip />
                  </PieChart>
                </ResponsiveContainer>
              </div>
            </div>
          </div>
        )}

        {activeTab === 'demographics' && (
          <div className="space-y-6">
            {/* Universities */}
            <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
              <h3 className="text-lg font-semibold text-gray-900 mb-4">
                All Universities ({surveyData.demographics.universities.length})
              </h3>
              <div className="space-y-2 max-h-96 overflow-y-auto">
                {surveyData.demographics.universities.map((uni, idx) => (
                  <div key={idx} className="flex items-center justify-between p-2 hover:bg-gray-50 rounded">
                    <span className="text-sm font-medium text-gray-700">{uni.name}</span>
                    <div className="flex items-center gap-2">
                      <div className="w-32 bg-gray-200 rounded-full h-2">
                        <div 
                          className="h-2 rounded-full" 
                          style={{ 
                            width: `${(uni.count/surveyData.totalResponses*100)}%`, 
                            backgroundColor: COLORS[idx%COLORS.length] 
                          }} 
                        />
                      </div>
                      <span className="text-sm font-semibold w-12 text-right">{uni.count}</span>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            {/* Majors */}
            <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
              <h3 className="text-lg font-semibold text-gray-900 mb-4">
                All Majors ({surveyData.demographics.majors.length})
              </h3>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-3">
                {surveyData.demographics.majors.map((major, idx) => (
                  <div key={idx} className="flex justify-between p-3 bg-gray-50 rounded-lg">
                    <span className="text-sm font-medium text-gray-700">{major.major}</span>
                    <span className="text-sm font-semibold">{major.count}</span>
                  </div>
                ))}
              </div>
            </div>
          </div>
        )}

        {activeTab === 'insights' && (
          <div className="space-y-6">
            {/* Custom Prompt */}
            <div className="bg-gradient-to-br from-purple-50 to-pink-50 rounded-xl shadow-sm p-6 border border-purple-200">
              <h3 className="text-lg font-semibold text-gray-900 mb-4 flex items-center gap-2">
                <MessageSquare className="w-5 h-5 text-purple-600" />
                Ask Anything About Your Data
              </h3>
              <div className="flex gap-2">
                <input
                  type="text"
                  value={customPrompt}
                  onChange={(e) => setCustomPrompt(e.target.value)}
                  onKeyPress={(e) => e.key === 'Enter' && handleCustomPrompt()}
                  placeholder="e.g., What are key differences between NUS and NTU students?"
                  className="flex-1 px-4 py-3 border border-purple-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
                />
                <button
                  onClick={handleCustomPrompt}
                  disabled={loading}
                  className="px-6 py-3 bg-purple-600 text-white rounded-lg hover:bg-purple-700 disabled:opacity-50 flex items-center gap-2"
                >
                  <Send className="w-4 h-4" />
                  Ask
                </button>
              </div>
            </div>

            {/* Pre-defined Analyses */}
            <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
              <h3 className="text-lg font-semibold text-gray-900 mb-4">Pre-defined Analyses</h3>
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
                {[
                  { id: 'patterns', label: 'Pattern Analysis', color: 'blue', icon: TrendingUp },
                  { id: 'dropoff', label: 'Drop-off Analysis', color: 'red', icon: AlertCircle },
                  { id: 'segments', label: 'Student Segments', color: 'purple', icon: Users },
                  { id: 'attractiveness', label: 'Attractiveness Drivers', color: 'green', icon: Sparkles },
                  { id: 'recommendations', label: 'Recommendations', color: 'orange', icon: MessageSquare }
                ].map(({ id, label, color, icon: Icon }) => (
                  <button
                    key={id}
                    onClick={() => analyzeWithAI(id)}
                    disabled={loading}
                    className={`p-4 border-2 rounded-lg transition-colors disabled:opacity-50 flex items-center gap-3 ${
                      color === 'blue' ? 'border-blue-200 hover:border-blue-400 hover:bg-blue-50' :
                      color === 'red' ? 'border-red-200 hover:border-red-400 hover:bg-red-50' :
                      color === 'purple' ? 'border-purple-200 hover:border-purple-400 hover:bg-purple-50' :
                      color === 'green' ? 'border-green-200 hover:border-green-400 hover:bg-green-50' :
                      'border-orange-200 hover:border-orange-400 hover:bg-orange-50'
                    }`}
                  >
                    <Icon className={`w-5 h-5 ${
                      color === 'blue' ? 'text-blue-600' :
                      color === 'red' ? 'text-red-600' :
                      color === 'purple' ? 'text-purple-600' :
                      color === 'green' ? 'text-green-600' :
                      'text-orange-600'
                    }`} />
                    <span className="font-semibold text-sm">{label}</span>
                  </button>
                ))}
              </div>
            </div>

            {/* Loading State */}
            {loading && (
              <div className="bg-white rounded-xl shadow-sm p-8 text-center">
                <div className="animate-spin rounded-full h-12 w-12 border-b-4 border-blue-600 mx-auto mb-4"></div>
                <p className="text-gray-600">Groq AI is analyzing...</p>
              </div>
            )}

            {/* AI Insights */}
            {aiInsights && !loading && (
              <div className="bg-gradient-to-br from-blue-50 to-indigo-50 rounded-xl shadow-sm p-6 border border-blue-200">
                <h3 className="text-lg font-semibold text-gray-900 mb-4 flex items-center gap-2">
                  <Brain className="w-6 h-6 text-blue-600" />
                  AI Insights
                </h3>
                <div className="text-gray-800 whitespace-pre-wrap bg-white rounded-lg p-6 shadow-sm">
                  {aiInsights}
                </div>
              </div>
            )}
          </div>
        )}

        {activeTab === 'completion' && (
          <div className="space-y-6">
            <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
              <h3 className="text-lg font-semibold text-gray-900 mb-4">Completion by Time</h3>
              <ResponsiveContainer width="100%" height={300}>
                <BarChart data={surveyData.completionPatterns.byTime}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="timeRange" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Bar dataKey="completed" fill="#10B981" name="Complete" radius={[8, 8, 0, 0]} />
                  <Bar dataKey="incomplete" fill="#EF4444" name="Incomplete" radius={[8, 8, 0, 0]} />
                </BarChart>
              </ResponsiveContainer>
            </div>

            <div className="bg-white rounded-xl shadow-sm p-6 border border-gray-100">
              <h3 className="text-lg font-semibold text-gray-900 mb-4">Drop-off Points</h3>
              <ResponsiveContainer width="100%" height={300}>
                <BarChart data={surveyData.completionPatterns.dropOffPoints} layout="vertical">
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis type="number" />
                  <YAxis 
                    dataKey="question" 
                    type="category" 
                    width={180} 
                    style={{ fontSize: '11px' }} 
                  />
                  <Tooltip />
                  <Bar dataKey="dropRate" fill="#EF4444" radius={[0, 8, 8, 0]} />
                </BarChart>
              </ResponsiveContainer>
            </div>
          </div>
        )}
      </div>

      {/* Footer */}
      <div className="bg-white border-t border-gray-200 mt-12">
        <div className="max-w-7xl mx-auto px-6 py-6">
          <div className="flex items-center justify-between flex-wrap gap-4">
            <div className="text-sm text-gray-500">
               Powered by Groq AI (Llama 3.1)  Data: 1,976 responses embedded
            </div>
            <button 
              onClick={exportReport} 
              className="px-4 py-2 text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 rounded-lg flex items-center gap-2 transition-colors"
            >
              <Download className="w-4 h-4" />
              Export Report
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SurveyAnalyticsDashboard;